import React from "react";
import posed from "react-pose";

import logo from "../../logo.svg";

const LogoSvg = posed.img({
  visible: {
    opacity: 1,
    transition: {
      duration: 900,
      ease: "easeIn"
    }
  },
  hidden: {
    opacity: 0,
    transition: {
      duration: 900,
      ease: "easeOut"
    }
  }
});

class HeaderLogo extends React.Component {
  state = {
    isVisible: false
  };

  componentDidMount() {
    this.setState({
      isVisible: true
    });
  }

  render() {
    return (
      <LogoSvg
        className={"ui image"}
        pose={this.state.isVisible ? "visible" : "hidden"}
        src={logo}
      />
    );
  }
}

export default HeaderLogo;
